import "./index.css";

const EachBook = (props) => {
  const { details } = props;
  const { title, author, cover_image } = details;
  return (
    <li className="eachBook">
      <img className="coverImage" src={cover_image} alt="coverImage" />
      <div className="content">
        <p>{title}</p>
        <p>{author}</p>
        <li className="details">{title}</li>
        <li className="details">{author}</li>
      </div>
    </li>
  );
};

export default EachBook;
